void fill_array(unsigned char ascii_array[],unsigned char sorted_array[],unsigned char red){
    int k=0;
    for(int i=0;i<47;i++){
            for(int j=0;j<62;j++){
                if(myPixels[i][j][0]==red){
                    ascii_array[k]=myPixels[i][j][1];
                    sorted_array[k]=myPixels[i][j][2];
                    k++;
                }
            }
    }
}

